ile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocIJThU_SXXtU4FdZT5PbUQx2OpfI2WThzoMjtOEy2O4Tg=s128-c0x00000000-cc-rp-mo-ba2\",\"rating\":1,\"relative_time_description\":\"11 months ago\",\"text\":\"The pump attendant is an unpleasant person considering the price of his fuel. He should be more than friendly. I will never return to this resort given the welcome I received.\\nMonsieur invents a shortage to refuse to sell fuel. This must be the client\'s head or skin color.\",\"time\":1678110976,\"translated\":true},{\"author_name\":\"Mike 94\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/110953473030036081825\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocLR1U7lxqEzjAbsV89344zfEmi-c-O1RL5Xq4eVumlX=s128-c0x00000000-cc-rp-mo\",\"rating\":1,\"relative_time_description\":\"a year ago\",\"text\":\"After consulting the TOTAL map of service stations, I went to this service station on 10\\/25\\/2022 to fill up with SP98. When I arrive, I notice that the pistols of SP95 and SP98 are hidden, fuel exhausted. In addition, a \\u201cPay before serving\\u201d sign is displayed on the pump.\\nA lady (not very friendly) comes out and tells me that there is no more gas. I point out to him that the TOTAL card indicates that there are some. She tells me that it is up to TOTAL to update it.\\nI did 5 kilometers for nothing!\\nToday, the TOTAL card still indicates the presence of the three fuels at this service station.\",\"time\":1666801020,\"translated\":true},{\"author_name\":\"Perola Miranda\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/106598672583940549108\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a-\\/ALV-UjV7rUlf9qCwumu_NvoWb1F9VgPL8EGwn0gqhZRVZeGs7A=s128-c0x00000000-cc-rp-mo-ba4\",\"rating\":1,\"relative_time_description\":\"3 years ago\",\"text\":\"The person who served me (if we can call this one a pump attendant?) is very unpleasant, super cold and complaining because there were several (3) company vans refueling there.\\nWhat exactly is its goal?\\nOf course I put a star so I can comment.\",\"time\":1609881392,\"translated\":true},{\"author_name\":\"christine Baudry\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/114296768098511727399\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocLjIK6NAoaFfETCM0f9t8NDsokRbnakrwifgAmx1kG8=s128-c0x00000000-cc-rp-mo\",\"rating\":1,\"relative_time_description\":\"a year ago\",\"text\":\"The attendant is incredibly friendly. At this point it\\u2019s really sick. Let him stop serving customers!\",\"time\":1673966260,\"translated\":true}],\"secondary_opening_hours\":[{\"open_now\":true,\"periods\":[{\"close\":{\"date\":\"2024-03-04\",\"day\":1,\"time\":\"2359\",\"truncated\":true},\"open\":{\"date\":\"2024-02-27\",\"day\":2,\"time\":\"0000\",\"truncated\":true}}],\"type\":\"TAKEOUT\",\"weekday_text\":[\"Monday: Open 24 hours\",\"Tuesday: Open 24 hours\",\"Wednesday: Open 24 hours\",\"Thursday: Open 24 hours\",\"Friday: Open 24 hours\",\"Saturday: Open 24 hours\",\"Sunday: Open 24 hours\"]},{\"open_now\":true,\"periods\":[{\"close\":{\"date\":\"2024-03-04\",\"day\":1,\"time\":\"2359\",\"truncated\":true},\"open\":{\"date\":\"2024-02-27\",\"day\":2,\"time\":\"0000\",\"truncated\":true}}],\"type\":\"ACCESS\",\"weekday_text\":[\"Monday: Open 24 hours\",\"Tuesday: Open 24 hours\",\"Wednesday: Open 24 hours\",\"Thursday: Open 24 hours\",\"Friday: Open 24 hours\",\"Saturday: Open 24 hours\",\"Sunday: Open 24 hours\"]}],\"types\":[\"gas_station\",\"convenience_store\",\"cafe\",\"store\",\"restaurant\",\"food\",\"point_of_interest\",\"establishment\"],\"url\":\"https:\\/\\/maps.google.com\\/?cid=1301508225765995413\",\"user_ratings_total\":16,\"utc_offset\":60,\"vicinity\":\"63-65 Ave