\\/115890166311970204261\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a-\\/ALV-UjVgWJcNAJyWtL693rDN3BhIbzmVmCCBSQeakmX5uu8ahwk=s128-c0x00000000-cc-rp-mo\",\"rating\":1,\"relative_time_description\":\"a year ago\",\"text\":\"Waiting for a new credit card I only had my checkbook and a little cash.\\nAlthough mentioned on the pumps (but I did not see it), this refusal was not legally mentioned in the reception building.\\nThe staff refused me payment by check, insulting and aggressive.\\nI called the police but being in a hurry,\\nI stripped myself of my last euros.\\nNot only does this station make big profits on our backs but it employs unqualified staff.\\nTo flee !!!!!\",\"time\":1675290565,\"translated\":true},{\"author_name\":\"Claudius\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/109739646310866572460\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocLm-Pvnd87i4DGY6cKqUO4qLCi1C9oOHfKy2uAZTajd=s128-c0x00000000-cc-rp-mo\",\"rating\":3,\"relative_time_description\":\"8 months ago\",\"text\":\"Inconceivable that, periodically and in the absence of a shortage, the SP98 pumps are neutralized due to technical problems. This station has become a grocery store that sometimes sells gasoline and at a high price. Sustainability of the company, surrounded by real estate developers?\",\"time\":1688023037,\"translated\":true},{\"author_name\":\"Roots Paname\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/116632056720006209152\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a-\\/ALV-UjXDjE6W57d8_5ygtT2WSAcHwBGJ5SdBNpSid0-_5mrlyQ=s128-c0x00000000-cc-rp-mo\",\"rating\":1,\"relative_time_description\":\"11 months ago\",\"text\":\"Sunday March 26, 2023\\naround 5:45 p.m.\\nI\'m at pump n4 for 98\\nI fill up I see a truck behind me once finished I push my scooter to leave my place for the truck\\nI arrive at the checkout the guy asks me where I was I tell him 4 for 98 I tell him it was cut by itself at 9 euros he tells me I can\'t see it on my screen so I tell him on the price stuck at 9 euros and I told him I think that made me 4l13\\nIt basically tells me that the 2 wheels are thieves because he has doubts about what I\'m saying because the person in the truck had to take out the gun I think that the biggest thieves are mainly the service stations 9 euros for 4 liters I wonder who the thief is I will avoid coming to this Station for this derogatory remark\",\"time\":1679850164,\"translated\":true},{\"author_name\":\"Didier PAHL\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/100054202387163171983\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a-\\/ALV-UjVHxghxMc7I-axX606XJ6dXo_NM49yKvmVJ4mAljyzq2tM=s128-c0x00000000-cc-rp-mo-ba5\",\"rating\":1,\"relative_time_description\":\"2 years ago\",\"text\":\"Lamentable, the tire pressure is chargeable, it\'s already not the best, but the employee on duty this Sunday refused to give me change for \\u20ac5 even though he had the extra. Fortunately a motorist allowed me to graciously use the remaining time to reinflate my rear tire of my motorbike (following an object on the A4) so \\u200b\\u200bthat I could return home. Station to avoid\",\"time\":1628438343,\"translated\":true},{\"author_name\":\"Jean-Etienne Bineau\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/100365668891138849186\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a-\\/ALV-UjUexRC0H-uM6rvgAITypLfZt0z98BWXrGiuinqPWhPNsIQ=s128-c0x00000000-cc-rp-mo-ba3\",\"rating\":2,\"relative_time_description\":\"10 months ago\",\"text\":\"Place open until 9:45 p.m.\",\"time\":1