-rp-mo\",\"rating\":1,\"relative_time_description\":\"9 months ago\",\"text\":\"EXPENSIVE station for an inexplicable BP!!\\nIn addition, very poorly received, the manager of the parcel relay refused to give me my parcel for being 5 minutes late while behind his grotesque counter...\",\"time\":1684262114,\"translated\":true},{\"author_name\":\"Sun Set\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/113636396027553673727\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocJ48cxeh2ZX1dNz4Ias3i00svd1zQGuoWseUoZtdbM9=s128-c0x00000000-cc-rp-mo\",\"rating\":1,\"relative_time_description\":\"a year ago\",\"text\":\"In the midst of a fuel shortage crisis, the station suddenly decides to close its cash register at 10 p.m. instead of 11 p.m.... very annoying after having queued for 2 hours with a baby in the car...\",\"time\":1665699078,\"translated\":true},{\"author_name\":\"R\\u00e9mi Wrona\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/104189986409308396491\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocLclVPTvZ61DFjcYEL3CGLoXC5Mg7mRkVBtP0yb3aIY=s128-c0x00000000-cc-rp-mo-ba3\",\"rating\":4,\"relative_time_description\":\"a year ago\",\"text\":\"Station with LPG big plus for me.\\n\\nHowever, BE CAREFUL with \\u201cpre-payment\\u201d by credit card. If the fuel price is less than what you took at the checkout, you must go there to get the ticket. The resort reimburses the rest in cash.\",\"time\":1651734962,\"translated\":true}],\"types\":[\"gas_station\",\"car_wash\",\"convenience_store\",\"point_of_interest\",\"store\",\"food\",\"establishment\"],\"url\":\"https:\\/\\/maps.google.com\\/?cid=16276965052203189646\",\"user_ratings_total\":77,\"utc_offset\":60,\"vicinity\":\"RN186, Route de Choisy, Cr\\u00e9teil\",\"website\":\"https:\\/\\/map.bp.com\\/fr-FR\\/FR\\/st